import React from 'react';
import Sidebar from './components/sidebar'
import Introduction from "./components/introduction";

import './css/style.css'

function App() {
  return (
      <>
    <div className="App">
        <Sidebar></Sidebar>
    </div>
      <div><Introduction></Introduction></div></>
  );
}

export default App;
